import React from 'react';

export const FilmList = ({ nameList }) => {
  const { name, results } = nameList;

  return (
    <div className="text-yellow-500 font-bold">
      <h1>La lista de peliculas de {name}</h1>
      <div>{results.FilmList}</div>
    </div>
  );
};
